  return (
    <div style={{ display: 'flex', gap: '16px' }}>
      <UserCard name="John Doe" age={28} address="123 Main St, Anytown" />
      <UserCard name="Jane Smith" age={34} address="456 Oak Ave, Somewhere" />
      <UserCard name="Alice Johnson" age={42} address="789 Pine Rd, Elsewhere" />
    </div>
  );
}

export default App;
